INSERT INTO `MetaDataItem` VALUES ('AccountActivationMessage','','Hi ##USERNAME## and welcome to ##WIKITITLE##!\nYou must activate your new ##WIKITITLE## Account within 24 hours, following the link below.\n\n##ACTIVATIONLINK##\n\nIf you have any trouble, please contact us at our Email address, ##EMAILADDRESS## .\n\nThank you.\n\nBest regards,\nThe ##WIKITITLE## Team.'),('EditNotice','','Please \'\'\'do not\'\'\' include contents covered by copyright without the explicit permission of the Author. Always preview the result before saving.{BR}\nIf you are having trouble, please visit the [http://www.screwturn.eu/Help.ashx|Help section] at the [http://www.screwturn.eu|ScrewTurn Wiki Website].'),('Footer','','<p class=\"small\">[http://www.screwturn.eu|ScrewTurn Wiki] version {WIKIVERSION}. Some of the icons created by [http://www.famfamfam.com|FamFamFam].</p>'),('Header','','<h1>{WIKITITLE}</h1>'),('PageFooter','','<div style=\"float: left;\">Logged in as <strong>{USERNAME}</strong>, you are in: {NAMESPACEDROPDOWN} &bull; {LOGINLOGOUT}</div>'),('PasswordResetProcedureMessage','','Hi ##USERNAME##!\nYour can change your password following the instructions you will see at this link:\n    ##LINK##\n\nIf you have any trouble, please contact us at our Email address, ##EMAILADDRESS## .\n\nThank you.\n\nBest regards,\nThe ##WIKITITLE## Team.'),('Sidebar','','<li>[Main_Page|Home]</li>\r\n<li><a href=\"http://go-mono.com/mono-downloads/download.html\">Download</a></li>\r\n<li><a href=\"http://www.mono-project.com/news/\">News</a></li>\r\n<li><a href=\"http://go-mono.com/store\">Store</a></li>\r\n<li><a href=\"#\">Mono Project</a>\r\n <ul>\r\n  <li>[Start]</li>\r\n  <li>[Contributing]</li>\r\n  <li>[Community]</li>\r\n  <li>[Support]</li>\r\n </ul>\r\n</li>\r\n<li><a href=\"#\">Wiki Navigation</a>\r\n <ul>\r\n  <li>[RandPage.aspx|Random Page]</li>\r\n  <li>[Edit.aspx|Create a new Page]</li>\r\n  <li>[AllPages.aspx|All Pages]</li>\r\n  <li>[Category.aspx|Categories]</li>\r\n  <li>[NavPath.aspx|Navigation Paths]</li>\r\n  <li>[AdminHome.aspx|Administration]</li>\r\n  <li>[Upload.aspx|File Management]</li>\r\n  <li>[Register.aspx|Create Account]</li>\r\n </ul>\r\n</li>\r\n'),('PageChangeMessage','','The page \"##PAGE##\" was modified by ##USER## on ##DATETIME##.\nAuthor\'s comment: ##COMMENT##.\n\nThe page can be found at the following address:\n##LINK##\n\nThank you.\n\nBest regards,\nThe ##WIKITITLE## Team.'),('DiscussionChangeMessage','','A new message was posted on the page \"##PAGE##\" by ##USER## on ##DATETIME##.\n\nThe subject of the message is \"##SUBJECT##\" and it can be found at the following address:\n##LINK##\n\nThank you.\n\nBest regards,\nThe ##WIKITITLE## Team.'),('ApproveDraftMessage','','A draft for the page \"##PAGE##\" was created or modified by ##USER## on ##DATETIME## and is currently held for **approval**.\nAuthor\'s comment: ##COMMENT##.\n\nThe draft can be found and edited at the following address:\n##LINK##\nYou can directly approve or reject the draft at the following address:\n##LINK2##\n\nPlease note that the draft will not be displayed until it is approved.\n\nThank you.\n\nBest regards,\nThe ##WIKITITLE## Team.');
/*!40000 ALTER TABLE `MetaDataItem` ENABLE KEYS */;
